import React, { useState, useEffect } from 'react';

import chiLogo from './pages/NFC/North/chiLogo.png';
import detLogo from './pages/NFC/North/detLogo.png';
import gnbLogo from './pages/NFC/North/gnbLogo.png';
import minLogo from './pages/NFC/North/minLogo.png';

import NFCSouth from './pages/NFC/South/teams';
import NFCEast from './pages/NFC/East/teams';
import NFCWest from './pages/NFC/West/teams';

import AFCNorth from './pages/AFC/North/teams';
import AFCSouth from './pages/AFC/South/teams';
import AFCEast from './pages/AFC/East/teams';
import AFCWest from './pages/AFC/West/teams';




function NewHome()
{
  const [teams, setTeams] = useState([]);

  useEffect(() => {
    const url = "/home";

    const fetchData = async () => {
      try
      {
        const response = await fetch(url);
        const data = await response.json();
        setTeams(data);
      }
      catch (error)
      {
        console.log("error", error);
      }
    };

    fetchData();
  }, []);


  function setEachMatchup(team)
  {
    return (team["Dallas CowboysTampa Bay Buccaneers"])
    if (team.find(a => a.includes("Dal")))
    {
      return (team)
    }

  }

  function setWeeklyMatchups()
  {
    return(
            teams.map(team =>
              <tr key={team.toString()}>
                <td className='matchups'>
                  {setEachMatchup(team)}
                </td>
              </tr>
            )
          )
  }


  return (
    <>
    <table className="allTeams">
      <tbody>

        <tr>
          <th >Week 1 Match ups</th>
        </tr>

        {setWeeklyMatchups()}

      </tbody>
    </table>
    </>
  );
}

export default NewHome;
